import React from 'react'
import './main.css';
import logo from './background.jpg';


export default function Login() {
  return (
  <>
     <section>
     <img src={logo} className="App-logo" alt="logo" />
        <div className='form-outer'>
            
            <div className='box'>
            <h2 className='mb-3'>Login</h2>
                    <input type="text" className='form-control mb-4' placeholder='Enter Your Name' />

                    <input type="password" className='form-control mb-4' placeholder='Enter Your Password' />

                    <button type="button" className='btn btn-warning'>Submit</button>
                </div>
        </div>
     </section>
  </>
  )
}
